{{ rash }} variables are builtin values gotten from execution context. - assert: that: - 'rash.args | length == 0' - 'rash.dir == "/"' - 'rash.path == "/builtins_example.rh"' - 'rash.user.uid == 1000' - 'rash.user.gid == 1000' src/vars/builtin.rs: #[derive(Serialize)]
pub struct Builtins { /// Args passed from command line execution. args: Vec<String>, /// Script directory absolute path. dir: PathBuf, /// Script absolute path. path: PathBuf, user: UserInfo,
} #[derive(Serialize)]
struct UserInfo { uid: u32, gid: u32,
}
